import React from 'react'
import styled from 'styled'

const StyledButton = styled.button`
  font-weight: bold;
  font-size: 16px;
`


const Button = ({last, ...props}) => (
    <button type={last ? 'submit' : 'button'} {...props}>
        {last ? 'Odoslať' : 'Ďalšia otázka'}
    </button>
)

export default Button
